1) LAUDO DE ANÁLISE 172.1P.0/2024 DO PRODUTO PIMENTA DO REINO EM PÓ, MARCA GOIÁS TEMPERO, COM RESULTADO SATISFATÓRIO PARA TODAS AS ANÁLISES REALIZADAS;
2) LAUDO DE ANÁLISE 173.1P.0/2024 DO PRODUTO ÁGUA MINERAL NATURAL SEM GÁS, MARCA LA PRIORI, COM RESULTADO SATISFATÓRIO PARA AS ANALISES REALIZADAS.
